  minTid = ''; ftid = '';
  ttid = '';
  gruppe = 'Enkel';
  detaljer = 'Ikke spesifisert';

  tilgjengeligeSykler = [];
  tilgjengeligUtstyr = []; tilgjengeligeBrett = 0;
  bId = '';
  runU = 0; runS = 0;
  sykkelType = ''; utstyrType = '';

  sykler = []; vSykler = []; sTyper = [];
  utstyr = []; vUtstyr = []; uTyper = [];

  number = 1;

  render() {
    return (
      <div className="mainView">
        <div className="mainViewUtleie">
